function getPlotlySeries(datum) {
    let categoryKeys = [];
    let series = new Array(datum.length);
    for (var i = 0; i < datum.length; i++) {
        let dataSeries = datum[i]['statistically_computed_time_series_monthly'];
        let yData = [];
        for (var j = 0; j < dataSeries.length; j++) {
            yData.push(dataSeries[j][1]);
            categoryKeys[j] = dataSeries[j][0];
        }
        series[i] = {
            x: categoryKeys,
            y: yData,
            type: 'scatter',
            marker: {
                color: datum[i]['scenario_color']
            },
            name: datum[i]['scenario_name'],
        };
    }
    return series;
}

function plot(data) {

    let datum = data['scenario_run_data'];

    var layout = {
        font: PLOTLY_FONT,
        yaxis: {
            title: {
                text: data['units']
            },
            gridcolor: '#CCCCCC'
        },
        xaxis:{
            gridcolor: '#CCCCCC'
        },
        legend: {
            orientation: 'h',
            xanchor: 'center',
            x: 0.5
        },
        showlegend: true,
        title: {
            text: data['month_period_title'] + ' ' + data['gui_link_title'] + '<br>(' + data['statistics'] + ')',
            font: {
                family: 'Lucida Grande", "Lucida Sans Unicode", "Verdana", "Arial", "Helvetica", "sans-serif',
                size: 20,
                color: 'black',
            }
        }
    };
    Plotly.newPlot('tester', getPlotlySeries(datum), layout, {
        displaylogo: false,
        modeBarButtonsToRemove: ['toImage', 'sendDataToCloud', 'editInChartStudio', 'lasso2d', 'select2d', 'toggleSpikelines', 'resetScale2d'],
        scrollZoom: true
    });
    $("#tester").mousedown((ev) => {
        if (ev.which === 3) {
            openContextMenu('#tester', ev, plotlyCopyToClipboard, plotlyExportFunction(document.getElementById("tester")));
        }
    })
}

function plotlyCopyToClipboard() {
    let plot = document.getElementById("tester");
    let layout = plot.layout;
    let data1 = plot.data;
    var text = layout['title']['text'] + '\n' + 'Month\t' + layout['yaxis']['title']['text'] + '\n';
    for (var i = 0; i < data1.length; i++) {
        text += '\t' + data1[i]['name']
    }
    text += '\n';
    let datum = data1[0];
    let xarr = datum['x'];
    for (var j = 0; j < xarr.length; j++) {
        text += (xarr[j]);
        for (var k = 0; k < data1.length; k++) {
            let yarr = data1[k]['y'];
            text += '\t' + yarr[j];
        }
        text += '\n';
    }
    copyTextToClipboard(text);
}
